('nuchart', 'browseedit', 'nuchart', 'Charts', 'zzzzsys_chart', 'zzzzsys_chart_id', '', 0, 0, 'SELECT * FROM zzzzsys_chart', '$(''#sch_array'').addClass(''js'');\n\n\n$(''#chart_sf000label'').val(''bob'').change();\n$(''#chart_sf000column1'').val(7).change();\n$(''#chart_sf000column2'').val(12).change();\n$(''#chart_sf000column3'').val(13.5).change();\n$(''#chart_sf001label'').val(''tim'').change();\n$(''#chart_sf001column1'').val(2).change();\n$(''#chart_sf001column2'').val(4).change();\n$(''#chart_sf001column3'').val(6).change();\n$(''#chart_sf002label'').val(''tom'').change();\n$(''#chart_sf002column1'').val(7).change();\n$(''#chart_sf002column2'').val(5).change();\n$(''#chart_sf002column3'').val(3).change();\n\nnuHasNotBeenEdited();\n\n\n\n\nfunction nuTestChart(){\n    \n    var a = nuSubformObject(''chart_sf'').graphData\n    var t = $(''#sch_type'').val();\n    var h = $(''#sch_title'').val();\n    var x = $(''#sch_vertical_label'').val();\n    var y = $(''#sch_horizontal_label'').val();\n\n    if(t == ''Pie Graph''){\n        nuChart(''chart_div'', ''PieChart'', a, h, x, y, ''lines'', false);\n    }\n\n    if(t == ''Line Graph''){\n        nuChart(''chart_div'', ''ComboChart'', a, h, x, y, ''lines'', false);\n    }\n\n    if(t == ''Bar Graph''){\n        nuChart(''chart_div'', ''ComboChart'', a, h, x, y, ''bars'', false);\n    }\n\n    if(t == ''Bar Graph - Stacked''){\n        nuChart(''chart_div'', ''ComboChart'', a, h, x, y, ''bars'', true);\n    }\n\n    if(t == ''Bar Graph - Horizontal''){\n        nuChart(''chart_div'', ''BarChart'', a, h, x, y, ''bars'', false);\n    }\n\n    if(t == ''Bar Graph - Horizontal and Stacked''){\n        nuChart(''chart_div'', ''BarChart'', a, h, x, y, ''bars'', true);\n    }\n\n\n}\n');
